ount Stickers | Kerneler Dark Mode | 491.0000 | 2010 |\n| 5 | 2010-01-01 | Canada | Stickers for Less | Holographic Goose  | 300.0000 | 2010 |\n\n","text/latex":"A tbl\\_ts: 6 × 7\n\\begin{tabular}{lllllll}\n id & date & country & store & product & num\\_sold & year\\\\\n <dbl> & <date> & <chr> & <chr> & <chr> & <dbl> & <dbl>\\\\\n\\hline\n\t 0 & 2010-01-01 & Canada & Discount Stickers & Holographic Goose  & 141.5574 & 2010\\\\\n\t 1 & 2010-01-01 & Canada & Discount Stickers & Kaggle             & 973.0000 & 2010\\\\\n\t 2 & 2010-01-01 & Canada & Discount Stickers & Kaggle Tiers       & 906.0000 & 2010\\\\\n\t 3 & 2010-01-01 & Canada & Discount Stickers & Kerneler           & 423.0000 & 2010\\\\\n\t 4 & 2010-01-01 & Canada & Discount Stickers & Kerneler Dark Mode & 491.0000 & 2010\\\\\n\t 5 & 2010-01-01 & Canada & Stickers for Less & Holographic Goose  & 300.0000 & 2010\\\\\n\\end{tabular}\n","text/plain":"  id date       country store             product            num_sold year\n1 0  2010-01-01 Canada  Discount Stickers Holographic Goose  141.5574 2010\n2 1  2010-01-01 Canada  Discount Stickers Kaggle             973.0000 2010\n3 2  2010-01-01 Canada  Discount Stickers Kaggle Tiers       906.0000 2010\n4 3  2010-01-01 Canada  Discount Stickers Kerneler           423.0000 2010\n5 4  2010-01-01 Canada  Discount Stickers Kerneler Dark Mode 491.0000 2010\n6 5  2010-01-01 Canada  Stickers for Less Holographic Goose  300.0000 2010"},"metadata":{}}],"execution_count":84},{"cell_type":"markdown","source":"This dataset represents a classical situation where many features can be aggregate/disaggregated in different ways to generate different series, as an example from this data we could generate (several) times series of daily sales:\n<ul>\n<li>For each product (summing by country and store) </li> \n<li>For each store (summing by countriy and product) </li>\n<li>For each country (summing by store and product) </li> \n</ul>\nTo clarify we usually distinguish between series having a (strictly) hierachical structure, where the aggregation order works naturally in a specific direction, as an example data collected by city, state and nation has a natural order (each nation has its states and its state has its cities); a <i>grouping structure</i> happens instead whenever the data has no partical hierarchy but can be \"crossed\" in different ways.</br>\nAn example of grouped data is our tsibble of sticker sales, we can decide to order by product, store of country interchangibly, since each product/store is present in more than one country: we therefore aggregate these feature by rouping them together, as indicated by the <*> operator (for hierarchical data we would have used the </> operator).</br>","metadata":{}},{"cell_type":"code","source":"train_gts <- train_ts %>% aggregate_key(country * store * product, num_sold = sum(num_sold, na.rm = TRUE))\nhead(train_gts)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-01-14T16:45:24.030563Z","iopub.execute_input":"2025-01-14T16:45:24.032112Z","iopub.status.idle":"2025-01-14T16:45:27.707239Z","shell.execute_reply":"2025-01-14T16:45:27.705182Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tbl_ts: 6 × 5</caption>\n<thead>\n\t<tr><th scope=col>date</th><th scope=col>country</th><th scope=col>store</th><th scope=col>product</th><th scope=col>num_sold</th></tr>\n\t<tr><th scope=col>&lt;date&gt;</th><th scope=col>&lt;chr*&gt;</th><th scope=col>&lt;chr*&gt;</th><th scope=col>&lt;chr*&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2010-01-01</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>85710.77</td></tr>\n\t<tr><td>2010-01-02</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>82699.98</td></tr>\n\t<tr><td>2010-01-03</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>&lt;aggregated&gt;</td><td>88476.10</td></tr>\