":{"image/png":{"width":900,"height":600}}}],"execution_count":14},{"cell_type":"markdown","source":"Once the tsibble is aggregated, we can use the fable package to fit the aggregated time series; there are different scenarios based on the model chosen such as:\n<ul>\n<li>**ETS **(however it doesn’t accept seasonality with period p > 24)</li>\n<li>**ARIMA**</li>\n<li>**TSLM**</li>\n</ul>\n\nand the strategy determining the order of the fit:\n<ul>\n<li>**bottom up**: the base series are fitted first, then higher order time series are derived.</li>\n<li>**top down**: the highest-hierarchy time series is fitted and the derived ones are obtained applying proportion to the top series, these proportion can be computed in different ways.</li>\n<li>**MinT (minimum trace) optimal reconciliation**: a collection of methods to minimize the error variance of the coherent forecasts.</li>\n</ul> ","metadata":{}},{"cell_type":"markdown","source":"<h3>ARIMA fit</h3>","metadata":{}},{"cell_type":"code","source":"f_w <- max(test_original$date) - min(test_original$date) + 1\ncat('Forecasting windows spans for ', f_w, ' days.')","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-01-14T16:46:10.930979Z","iopub.execute_input":"2025-01-14T16:46:10.932972Z","iopub.status.idle":"2025-01-14T16:46:10.953073Z","shell.execute_reply":"2025-01-14T16:46:10.951005Z"}},"outputs":[{"name":"stdout","text":"Forecasting windows spans for  1095  days.","output_type":"stream"}],"execution_count":87},{"cell_type":"code","source":"fit_ARIMA <- train_gts %>% model(base = ARIMA(num_sold ~ PDQ(0, 0, 0) + pdq(d = 0) +\n                  fourier(period = 7, K = 3) +\n                  fourier(period = 365, K = 5) ) ) %>% reconcile(\n    bu = bottom_up(base)#,\n    #mint = min_trace(base, method = 'mint_shrink')\n    ) ","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-01-14T16:46:21.959285Z","iopub.execute_input":"2025-01-14T16:46:21.961150Z","iopub.status.idle":"2025-01-14T17:30:1